import React from 'react';
import Filter from "../Filter/filter";
import {Nav,Row,Col} from 'react-bootstrap'
import classes from './navbar.module.css';

import {Link} from 'react-router-dom'

const Navbar = (props) => {
    const filter = () => {
        document
            .querySelector(".Filter")
            .classList
            .toggle("hide");
        console.log("filterOption");
    };
    return (
        <Row className={classes.Nav}>
            <Col sm={6}>
                <Nav fill variant="tabs" defaultActiveKey="/home">
                    <Nav.Item>
                        <Link to="/"><p className={cx(classes.Navlink,props.view == "NearestRides" ? "active" : "")} href="/">Nearest rides</p></Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link className={classes.Navlink,props.view == "UpcomingRides" ? "active" : ""} eventKey="/upcoming">Upcoming rides(4)</Nav.Link>
                    </Nav.Item>
                    <Nav.Item>
                        <Nav.Link className={classes.Navlink,props.view == "PastRides" ? "active" : ""} eventKey="/past">Past rides (3)</Nav.Link>
                    </Nav.Item>
                </Nav>
            </Col>
            <Col md={{ offset: 4 ,span: 2}}>
                <Filter/>
            </Col>
        </Row>
    );
};

export default Navbar;
